import React from 'react';
import styles from './About1.modules.css';

const About1 = () => (
  <div style={{ width: '80%', height: 500, border: '1px solid black' }}>
    <div style={{ fontSize: '19px', fontWeight: 500, marginTop: 10, marginLeft: 20 }}>
      Tech Stack!!
    </div>
    <div className={styles.skills_1}>
      하이
    </div>
  </div>
);

export default About1;
